import React from 'react';
import { motion } from 'framer-motion';
import { FaGithub, FaExternalLinkAlt } from 'react-icons/fa';

const projects = [
  {
    title: 'Project 1',
    description: 'A brief description of your first project and its key features.',
    technologies: ['React', 'Node.js', 'MongoDB'],
    githubLink: '#', // Add your GitHub link here
    liveLink: '#', // Add your live demo link here if available
    image: '/images/project1.jpg',
  },
  {
    title: 'Project 2',
    description: 'A brief description of your second project and its key features.',
    technologies: ['React', 'Firebase', 'Tailwind CSS'],
    githubLink: '#', // Add your GitHub link here
    liveLink: '#', // Add your live demo link here if available
    image: '/images/project2.jpg',
  },
  {
    title: 'Project 3',
    description: 'A brief description of your third project and its key features.',
    technologies: ['C#', 'SQL', 'Entity Framework'],
    githubLink: '#', // Add your GitHub link here
    liveLink: '#', // Add your live demo link here if available
    image: '/images/project3.jpg',
  },
  {
    title: 'Project 4',
    description: 'A brief description of your fourth project and its key features.',
    technologies: ['FastAPI', 'Python', 'PostgreSQL'],
    githubLink: '#', // Add your GitHub link here
    liveLink: '#', // Add your live demo link here if available
    image: '/images/project4.jpg',
  },
];

const Projects = () => {
  return (
    <div className="py-12">
      <motion.h1
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        className="text-4xl font-bold text-center mb-12"
      >
        My <span className="text-accent">Projects</span>
      </motion.h1>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-8 max-w-6xl mx-auto px-4">
        {projects.map((project, index) => (
          <motion.div
            key={project.title}
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: index * 0.1 }}
            className="bg-secondary rounded-lg overflow-hidden shadow-lg"
          >
            <div className="h-48 bg-gray-700">
              {/* Replace with actual project image */}
              <img
                src={project.image}
                alt={project.title}
                className="w-full h-full object-cover"
              />
            </div>
            <div className="p-6">
              <h2 className="text-xl font-bold mb-2">{project.title}</h2>
              <p className="text-gray-300 mb-4">{project.description}</p>
              <div className="flex flex-wrap gap-2 mb-4">
                {project.technologies.map((tech) => (
                  <span
                    key={tech}
                    className="bg-accent text-white text-sm px-3 py-1 rounded-full"
                  >
                    {tech}
                  </span>
                ))}
              </div>
              <div className="flex space-x-4">
                <a
                  href={project.githubLink}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="bg-gray-700 hover:bg-gray-600 text-white font-bold py-2 px-4 rounded-lg flex items-center space-x-2 transition duration-300"
                >
                  <FaGithub />
                  <span>Source Code</span>
                </a>
                {project.liveLink && (
                  <a
                    href={project.liveLink}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="bg-accent hover:bg-blue-600 text-white font-bold py-2 px-4 rounded-lg flex items-center space-x-2 transition duration-300"
                  >
                    <FaExternalLinkAlt />
                    <span>Live Demo</span>
                  </a>
                )}
              </div>
            </div>
          </motion.div>
        ))}
      </div>
    </div>
  );
};

export default Projects;
